import React from 'react';
import PropTypes from 'prop-types';


const ContactList = () => {
    return (
        <div>
                  <table className=''>
          <thead>
            <tr>
              <th>Nombre</th>
              <th>Apellido</th>
              <th>Status</th>
              <th></th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <td>carmen</td>
              <td>lopez</td>
              <td>conectada</td>
              <td>button</td>
            </tr>
          </tbody>
      </table>
        </div>
    );
};


ContactList.propTypes = {

};


export default ContactList;
